import React from 'react'

class Projects extends React.Component {
  state = {
    loaded: false,
    sort: "last_name"
  };

  example_user_data = [
    {
      first_name: "Luke",
      last_name: "Skywalker",
      trade_name: "Plumber"
    },
    {
      first_name: "General",
      last_name: "Akkbar",
      trade_name: "General Manager"
    },
    {
      first_name: "Obi-wan",
      last_name: "Kenobi",
      trade_name: "Technician"
    },
    {
      first_name: "Han",
      last_name: "Solo",
      trade_name: "General Contractor"
    },
    {
      first_name: "Lando",
      last_name: "Calrissian",
      trade_name: "Project Manager"
    }
  ];



  componentDidMount() {
    setTimeout(()=>{
      this.setState({loaded: true});
      this.setState({users: [...this.example_user_data]})
    }, 5000);
  }

  SelectFilter = (e) => {
    // let id=parseInt(e.currentTarget.dataset.id,10);
    console.log(e.target.value);
  }

  render() {
    const user_nodes = [];



    return (<div>
      {this.state.loaded ? (
        <div className={"scheduler"} >
          <select onChange={this.SelectFilter}>
            <option value="last_name">Last Name</option>
            <option value="first_name">First Name</option>
            <option value="trade_name">Trade</option>
          </select>
          <ul>{user_nodes}</ul>
        </div>
      ):(
        <div className={"scheduler loading"} >
          <ul>
            <li key="placeholder-1"></li>
            <li key="placeholder-2"></li>
            <li key="placeholder-3"></li>
            <li key="placeholder-4"></li>
            <li key="placeholder-5"></li>
            <li key="placeholder-6"></li>
            <li key="placeholder-7"></li>
            <li key="placeholder-8"></li>
            <li key="placeholder-9"></li>
            <li key="placeholder-10"></li>
          </ul>
        </div>
      )}
    </div>);
  }
}

export default Projects
